import React, { Component, Fragment } from 'react'
import Header from '../Component/Header/Header'
import Footer from '../Component/Footer/Footer'

class FavoritesPage extends Component {
    render() {
        return (
            <Fragment>
                <Header />
                <Footer />
            </Fragment>
        )
    }
}

export default FavoritesPage
